import React, { useState } from 'react'

export default function Travel() {

  const [currentMenu, setCurrentMenu] = useState('menu1');

  const handleClick = (menuId) => {
    setCurrentMenu(menuId);
  };

  return (
    <div className="container">
    <div className={`menu-column ${currentMenu === 'menu1' ? 'active' : ''}`} onClick={() => handleClick('menu1')}>
      <h3 className="menu-title">Menu 1</h3>
      {currentMenu === 'menu1' && (
        <div className="menu-content">
          <ul>
            <li>Menu item 1</li>
            <li>Menu item 2</li>
            <li>Menu item 3</li>
          </ul>
        </div>
      )}
    </div>

    <div className={`menu-column ${currentMenu === 'menu2' ? 'active' : ''}`} onClick={() => handleClick('menu2')}>
      <h3 className="menu-title">Menu 2</h3>
      {currentMenu === 'menu2' && (
        <div className="menu-content">
          <ul>
            <li>Menu item A</li>
            <li>Menu item B</li>
            <li>Menu item C</li>
          </ul>
        </div>
      )}
    </div>

    <div className={`menu-column ${currentMenu === 'menu3' ? 'active' : ''}`} onClick={() => handleClick('menu3')}>
      <h3 className="menu-title">Menu 3</h3>
      {currentMenu === 'menu3' && (
        <div className="menu-content">
          <ul>
            <li>Menu item X</li>
            <li>Menu item Y</li>
            <li>Menu item Z</li>
          </ul>
        </div>
      )}
    </div>
  </div>
  )
}
